import SHOP_ACTION_TYPES from './shop.types';



export const getCollectionStart = () => ({
    type: SHOP_ACTION_TYPES.GET_COLLECTIONS_START
})

export const getCollectionSuccess = data => ({
    type: SHOP_ACTION_TYPES.GET_COLLECTIONS_SUCCESS,
    payload : data
})
